import logoImg from "./assets/images/logo/logo.svg";
import "./Header.css";
function Header() {
  return (
    <header>
      <a href="/">
        <img src={logoImg} alt="logo" />
      </a>
      <a href="/">
        <p className="headerButton">자유게시판</p>
      </a>
      <a href="items.html">
        <p className="headerButton">중고마켓</p>
      </a>
    </header>
  );
}
export default Header;
